tables.table_schema:
CREATE TABLE quantum_experiments (
  experiment_id UUID PRIMARY KEY,
  experiment_name TEXT NOT NULL,
  experiment_date TIMESTAMP NOT NULL,
  experiment_description TEXT
);

CREATE TABLE quantum_results (
  result_id UUID PRIMARY KEY,
  experiment_id UUID REFERENCES quantum_experiments(experiment_id),
  result_data JSONB
);

CREATE TABLE quantum_experiments (
  experiment_id INT PRIMARY KEY,
  experiment_name VARCHAR(255),
  experiment_date DATE,
  quantum_protocol VARCHAR(100),
  research_team_id INT
);

CREATE TABLE experiment_results (
  result_id INT PRIMARY KEY,
  experiment_id INT,
  result_data JSONB,
  result_date TIMESTAMP,
  FOREIGN KEY (experiment_id) REFERENCES quantum_experiments(experiment_id)
);

CREATE TABLE research_teams (
  team_id INT PRIMARY KEY,
  team_name VARCHAR(255),
  team_lead VARCHAR(100),
  team_location VARCHAR(100)
);

CREATE TABLE researchers (
  researcher_id INT PRIMARY KEY,
  researcher_name VARCHAR(100) NOT NULL,
  researcher_email VARCHAR(100)
);
